const Result = (props) => {
	
	

    
	return (
	
		<>	
		<p className="subtitle"> Result Page</p>
		<table className="table1">
                        <thead>
                            <tr>
                                <td className="th1">참여 인원</td>
                                <td className="th2">추천 시간</td>
                            </tr>
                        </thead>
                     
                    </table>	
		</>
	);
};

export default Result;
